import { Input, Avatar, Button, ListItem } from 'react-native-elements';
import React from 'react';
import { StyleSheet, Text, View, ScrollView } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import data from '../data.json'


const GroupManagement = () => {

    const employees = (src) => {
        return src.map((el, index) => {
            const asd=()=>{
                for(let key1 in el) {
                    if([key1] === el.first_name || [key1] === el.last_name) continue
                }
                return <ListItem.Subtitle>{[key1]}</ListItem.Subtitle>
            }

            return (
                <ListItem key={index} bottomDivider>
                <Avatar rounded title="MD" size="xlarge"/>
                <ListItem.Content>
                    <ListItem.Title>{el.first_name+" "+el.last_name}</ListItem.Title>
                    <ListItem.Subtitle>{el.gender}</ListItem.Subtitle>
                    <ListItem.Subtitle>{el.department}</ListItem.Subtitle>
                    <ListItem.Subtitle>{el.job_title}</ListItem.Subtitle>
                    <ListItem.Subtitle>{el.country+'/'+el.city}</ListItem.Subtitle>
                </ListItem.Content>
            </ListItem>
            )
        })


    }
    return (
        <ScrollView>
            <View>
                {employees(data)}
            </View>
            <Button
                title="Finish"
                type="outline"
            />
        </ScrollView>
    )
}

export default GroupManagement;
